import {NavBar, Icon, List,InputItem,Button} from "antd-mobile";

class EditName extends Component {
    onClick = ()=>{
        update_userName
    }
    nameRef = React.createRef();
    render() {
        return (
            <div>
            <NavBar
                mode="light"
                icon={<Icon type="left" />}
                onLeftClick={() => this.props.history.goBack()}



            >Update Name</NavBar>
                <List >
                    <InputItem
                        ref={this.nameRef}

                    >Name</InputItem>
                    <Button type={"primary"} onClick={this.onClick}>Done</Button>
                </List>
            </div>
        );
    }
}

export default EditName;
